import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todos, setTodos] = useState([]);
  const [unresolvedTodos, setUnresolvedTodos] = useState([]);
  const [resolvedTodos, setResolvedTodos] = useState([]);

  useEffect(() => {
    axios.get('http://jsonplaceholder.typicode.com/todos')
      .then(response => {
        setTodos(response.data);
        setUnresolvedTodos(response.data.filter(todo => !todo.completed));
        setResolvedTodos(response.data.filter(todo => todo.completed));
      })
      .catch(error => {
        console.error('Error fetching todos:', error);
      });
  }, []);

  return (
    <div className="App">
      <h1>Lista de Pendientes de la NFL</h1>
      <div>
        <h2>Lista de todos los pendientes (solo IDs)</h2>
        <ul>
          {todos.map(todo => (
            <li key={todo.id}>{todo.id}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes (IDs y Titles)</h2>
        <ul>
          {todos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.title}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes sin resolver (ID y Title)</h2>
        <ul>
          {unresolvedTodos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.title}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes resueltos (ID y Title)</h2>
        <ul>
          {resolvedTodos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.title}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes (IDs y userID)</h2>
        <ul>
          {todos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.userId}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes resueltos (ID y userID)</h2>
        <ul>
          {resolvedTodos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.userId}</li>
          ))}
        </ul>
      </div>
      <div>
        <h2>Lista de todos los pendientes sin resolver (ID y userID)</h2>
        <ul>
          {unresolvedTodos.map(todo => (
            <li key={todo.id}>{todo.id} - {todo.userId}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
